#
# TABLE STRUCTURE FOR: cabang
#

DROP TABLE IF EXISTS `cabang`;

CREATE TABLE `cabang` (
  `id_cabang` int(11) NOT NULL AUTO_INCREMENT,
  `cabang` varchar(50) DEFAULT NULL,
  `no_rekening` varchar(30) DEFAULT NULL,
  `bank` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id_cabang`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;



#
# TABLE STRUCTURE FOR: customer
#

DROP TABLE IF EXISTS `customer`;

CREATE TABLE `customer` (
  `id_customer` int(11) NOT NULL AUTO_INCREMENT,
  `customer_code` varchar(20) DEFAULT NULL,
  `nama` varchar(255) DEFAULT NULL,
  `handphone` varchar(20) DEFAULT NULL,
  `email1` varchar(255) DEFAULT NULL,
  `email2` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_customer`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=14160 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;



#
# TABLE STRUCTURE FOR: info
#

DROP TABLE IF EXISTS `info`;

CREATE TABLE `info` (
  `id_info` int(11) NOT NULL,
  `info` text DEFAULT NULL,
  `publish` enum('1','0') DEFAULT '0',
  PRIMARY KEY (`id_info`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: reminder
#

DROP TABLE IF EXISTS `reminder`;

CREATE TABLE `reminder` (
  `id_reminder` int(11) NOT NULL AUTO_INCREMENT,
  `customer_code` varchar(50) DEFAULT NULL,
  `invoice_date` date DEFAULT NULL,
  `amount_total` int(11) DEFAULT NULL,
  `remark` text DEFAULT NULL,
  `email1` varchar(255) DEFAULT NULL,
  `email2` varchar(255) DEFAULT NULL,
  `top` varchar(255) DEFAULT NULL,
  `invoice_number` varchar(30) DEFAULT NULL,
  `handphone` varchar(20) DEFAULT NULL,
  `invoice_due_date` varchar(20) DEFAULT NULL,
  `status` enum('ACTIVE','PAID','EXPIRED') DEFAULT 'ACTIVE',
  `file1` varchar(255) DEFAULT NULL,
  `file2` varchar(255) DEFAULT NULL,
  `file3` varchar(255) DEFAULT NULL,
  `user` int(11) DEFAULT NULL,
  `to_send` int(1) DEFAULT 0,
  `id_cabang` int(11) DEFAULT NULL,
  PRIMARY KEY (`id_reminder`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id_user` int(11) NOT NULL AUTO_INCREMENT,
  `nama_user` varchar(255) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `foto_user` varchar(255) DEFAULT NULL,
  `level` varchar(20) DEFAULT NULL,
  `id_cabang` int(11) DEFAULT NULL,
  `no_telp` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`id_user`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;



